import myImage from './images/Logo.png'

export default function Navbar() {
  return (
    <nav className="nav">
      <div className="logo-container">
        <img src={myImage} className='img' alt="Project Logo" />
        <h1>Beyond Borders</h1>
      </div>
      <div>

      </div>
      
    </nav>
  );
}
